        setNaviationData(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setLoading(false);
      });
  }, []);


  return (
    <div className="App">
      <ComponentLv1/>
    </div>
  );
}

export default App;
